import React from 'react';
import {useNavigate} from "react-router-dom";

const NavigateButtons = () => {
    let navigate = useNavigate();
    const routeChange = () =>{ 
        let path = `/clients`; 
        navigate(path);
      }

    return (
        <>
            <div class="container" >
                <div class="row justify-content-end">
                    <h1 className="text-center">Navigation</h1>
                </div>
                <div class="row justify-content-end">
                    <button onClick={routeChange} className="btn btn-success m-1">Products</button>
                    <button onClick="location.href='https://google.com'" className="btn btn-warning m-1">Clients</button>
                    <button onClick="location.href='https://google.com'" className="btn btn-primary m-1">Orders</button>
                </div>
            </div>
        </>
    );
};

export default NavigateButtons;
